import React, { useState } from "react";
import './attendence.css';
import InputField from "../../components/InputField";
import ButtonField from "../../components/ButtonField";

const AttendanceSheet = () => {
  const [hidden, setHidden] = useState(true);
  const [attendance, setAttendance] = useState("");

  return (
    <>
      <div className="container-fluid p-3">
        <div className="row">
          <div className="col-md-9">
            <p>1 September 2023</p>
          </div>
          <div className="col-md-3">
            <InputField classname="inputSize200" text={'date'} />
          </div>
        </div>
        <div className="row">
          <div className="col-12">
            <div className="table-responsive">
              <table className="table">
                <thead>
                  <tr>
                    <th className="fixed-width">Eid</th>
                    <th className="fixed-width">Name</th>
                    <th className="fixed-width">D.O.B</th>
                    <th className="fixed-width">D.O.J</th>
                    <th className="expandable text-end">Attendance</th>
                  </tr>
                </thead>
                <tbody>
                  <tr>
                    <th className="fixed-width" scope="row">1</th>
                    <td className="fixed-width">Mark</td>
                    <td className="fixed-width">Otto</td>
                    <td className="fixed-width">@mdo</td>
                    <td className={`expandable text-end ${attendance === "Present" ? "text-success" : "text-danger"}`}>
                      {hidden && (
                        <>
                          <ButtonField
                            label="Absent"
                            onClick={() => {
                              setAttendance("Absent");
                              setHidden(false);
                            }}
                            classname="btn btn-outline-dark me-2"
                          />
                          <ButtonField
                            label="Present"
                            onClick={() => {
                              setAttendance("Present");
                              setHidden(false);
                            }}
                            classname="btn btn-success"
                          />
                        </>
                      )}
                      {attendance === "" ? "" : attendance}
                    </td>
                    <td className="text-center">
                      <div className="dropdown">
                        <button className="btn btn-light dropdown-toggle" type="button" id="dropdownMenuButton" data-bs-toggle="dropdown" aria-expanded="false">
                          <i className="fa fa-ellipsis-v"></i>
                        </button>
                        <ul className="dropdown-menu" aria-labelledby="dropdownMenuButton">
                          <li><a className="dropdown-item" href="#"><i className="fa fa-sun-o"></i> Half Day</a></li>
                          <li><a className="dropdown-item" href="#"><i className="fa fa-sun-o"></i> Early Leave</a></li>
                        </ul>
                      </div>
                    </td>
                  </tr>
                </tbody>
              </table>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default AttendanceSheet;
